import { MakerNav } from "../../component/Navbar/homeNav"
import './Myprinters.css';
import Web3 from "web3";
import { useNavigate } from "react-router-dom";
import { useEffect,useState} from "react";
import OnBoarding from "../../SmartContracts/OnBoarding/OnBoarding";

export default function MyPrinters(){

    //const navigate=useNavigate();
    const [printerList,setPr]=useState('');
    const navigate=useNavigate();
    let result='';


    useEffect(()=>{

        async function getPrintersData(){
            const boarding=new OnBoarding();
            const web3=new Web3();
            let res =await boarding.getPrinters();

            res.forEach((value,key)=>{

                    result= 
                    <tr key={key} className="printers" onClick={()=>navigate('/myprinters/'+value.name+'&&'+key)}>
                        <td key={value.name+"name"}> {web3.utils.toUtf8(value.name)} </td>
                        <td key={value.volume+"volume"}>{value.volume}</td>
                        <td key={value.maxPrintTemperature}>  {value.maxPrintTemperature} </td>
                    </tr>  
            })
            setPr(result);


        };
        getPrintersData();
        })

    return(
        <div>
             <MakerNav/>
            <div className="printerTable">
            <h1>My printers</h1>


            <table className="myPrinters">
                <tbody>
                    <tr>
                        <th>Name</th>
                        <th>Volume</th>
                        <th>Max printer temperature</th>
                    </tr>
                    {printerList} 
                </tbody> 
            </table>


            </div>

        </div>
    )
}








